column64:
 ; ; ;●Found dirty clothes in a drawer from a previous guest.  
●Towels were in poor condition. Two of the bath towels had holes in them.  
●The thermostat did not work the first couple of nights to make the room cooler.  We had to crack the sliding door open to cool down.  It seemed to work on our 3rd night.;Make sure to check the drawers for items left by previous guests.; ;The air freshener pumped throughout the ventilation system in lobby area was overpowering and not necessary.  I am very sensitive to scents and do not want to breathe in toxic chemicals.   It is not good for anyone's health.  Maybe try something natural like essential oils.; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ;

