column64:
 ; ; ;The only small complaint I had was my room was extremely cold and I wish I had more control over the temperature.  The hotel was able to send the maintenance person up who was extremely nice and personable and he brought me a space heater which ended up working just fine; just a minor inconvenience.  It was nice though because I had already unpacked and didn't want to change rooms.; ;Really nice lady barista downstairs and she made good coffee drinks.
Maintenance guy was extremely nice.
Our catering team was great too.; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ;

